import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Login from './pages/Login';
import User from './pages/User';
import AdminDashboard from './pages/AdminDashboard';
import Home from './pages/Home'; // If you have a home page
import Register from './pages/Register'; // If you have registration

import ProtectedRoute from './components/ProtectedRoute'; // The auth guard component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />  {/* Your home route */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Protected user dashboard */}
        <Route
          path="/user"
          element={
            <ProtectedRoute>
              <User />
            </ProtectedRoute>
          }
        />

        {/* Protected admin dashboard */}
        <Route
          path="/admindashboard"
          element={
            <ProtectedRoute>
              <AdminDashboard />
            </ProtectedRoute>
          }
        />

        {/* Add other routes here */}
      </Routes>
    </Router>
  );
}

export default App;
